import React, { useState } from "react";

// reactstrap components
import {
  Button,
  NavItem,
  NavLink,
  Nav,
  TabContent,
  TabPane,
  Container,
  Row,
  Col,
  UncontrolledTooltip,
  Card,
  CardHeader,
  CardBody,
} from "reactstrap";

// core components
import ProfilePageHeader from "./Header/ProfilePageHeader";
import DarkFooter from "./Footers/DarkFooter.js";

function ProfilePage() {


  const redirectToFacebook = () => {
    window.location.href = "https://www.facebook.com/blinkzrpn"
  }

  const redirectToLinkedin = () => {
    window.location.href = "https://www.linkedin.com/in/theerapon-rattapantanon-595a86167/"
  }

  const redirectToGithub = () => {
    window.location.href = "https://github.com/blinkz333"
  }

  React.useEffect(() => {
    document.body.classList.add("profile-page");
    return function cleanup() {
      document.body.classList.remove("profile-page");
    };
  });

  return (
    <>
      <div className="wrapper">
        <ProfilePageHeader />



        <DarkFooter />
      </div>

    </>
  );
}

export default ProfilePage;
